        """
        :type nums: List[int]
        :rtype: int
        """

        if len(nums) < 3:
            return 0

        count = 0
        for i in range(len(nums)-2):
            if nums[i+2] - nums[i+1] == nums[i+1] - nums[i]:
                count += 1
                j = i + 1
                while j < len(nums)-1 and nums[j+1] - nums[j] == nums[j] - nums[j-1]:
